import React from 'react';

const HeroCard = ({hero}) => {
    console.log(hero.name)
    return (
        <>
            {/*<img src={process.env.REACT_APP_API_URL + hero.img} alt=""/>*/}
            <p>{process.env.REACT_APP_API_URL + hero.img}</p>
        </>
    );
};

export default HeroCard;
